import { Component } from '@angular/core';

@Component({
  selector: 'app-cabecalho',
  templateUrl: './cabecalho.component.html',
  styleUrls: ['./cabecalho.component.css']
})
export class CabecalhoComponent {

}
<mat-toolbar  color="primary">
  <mat-toolbar-row>
    <span>Site do Wizarding World</span>
  </mat-toolbar-row>
</mat-toolbar>
<nav mat-tab-nav-bar  backgroundColor="primary" [tabPanel]="tabPanel">
  <a mat-tab-link routerLink="">Home</a>
  <a mat-tab-link routerLink="personagens">Personagens</a>
  <a mat-tab-link routerLink="contato">Contato</a>
  <a mat-tab-link routerLink="info">Info</a>
</nav>
<mat-tab-nav-panel #tabPanel></mat-tab-nav-panel>
